#include <bits/stdc++.h>

using namespace std;

class Solution {
 public:
  int subarrayBitwiseORs(vector<int>& arr) {
    unordered_set<int> current, ans;
    for (int a : arr) {
      unordered_set<int> next = {a};
      for (int c : current) {
        next.insert(c | a);
      }
      current = next;
      for (int c : current) {
        ans.insert(c);
      }
    }
    return ans.size();
  }
};

class Solution2 {
 public:
  int subarrayBitwiseORs(vector<int>& arr) {
    vector<int> ans;
    int l = 0, r = 0;
    for (int a : arr) {
      r = ans.size();
      ans.push_back(a);
      for (int i = l; i < r; ++i) {
        if (ans.back() != (ans[i] | a)) {
          ans.push_back(ans[i] | a);
        }
      }
      l = r;
    }
    return unordered_set<int>(ans.begin(), ans.end()).size();
  }
};

